const axios = require('axios');

//var url = 'http://192.168.0.96:8019/eye/rest/library/111/personnels';
var url = 'http://127.0.0.1:8080/eye/rest/library/Test/personnels';
var timeout = 1000;
var headers = {
    "Content-Type": "application/json",
    "version": "1.0.0",
};

var sendPersonnel = function(persion, callback) {
	var data = persion;
	axios({
	    method:'post',
	    url,
	    headers,
	    data,
	    timeout
	})
	.then(function (response) {
		console.log(JSON.stringify(response.data));
		if(callback !== undefined) {
			callback(response.data);
		}
	})
	.catch(function (error) {
	    console.log(error);
	});
};

